import './App.css';
import img from './profile.jpg';
const user = {
      name : "shekil",
      age : 21,
      img : "./profile.jpg",
      imgSize : 90
};


function App() {
  return (
    <>
      <h1>{user.name}</h1>
      <img 
        className='avatar'
        src={user.img}
        alt={'image for '+ user.name}
        style={{
          width: user.imgSize,
          height: user.imgSize
        }}
      />

    </>
  );
}



export default App;
